import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import './indexx.css';
import Sdata from './Sdata';

ReactDOM.render(
  <>
    <h1 className='heading_style'> List of top 5 thinks love most</h1>
    <Card
      imgSrc={Sdata[0].imgSrc}
      title={Sdata[0].title}
      sname={Sdata[0].sname}
      link={Sdata[0].link} />
  </>
  ,
  document.getElementById('root')
);
